      "description": "<p>Pantalla asombrosa para un desplazamiento verdaderamente fluido</p><p>Ampliá tu visión con la pantalla Infinity-U de 6,4\" del Galaxy A22 y mirá todo lo que te estabas perdiendo. Gracias a la pantalla Super Amoled HD+ que alcanza los 600 nits1 para lograr más claridad, tus contenidos se ven nítidos, definidos y deslumbrantes. Además, Real Smooth mantiene el desplazamiento fluido en tus juegos y redes sociales.</p><br><p>Diseño elegante</p><p>El diseño elegante del Galaxy A22 le brinda un aspecto atractivo y moderno. Sus curvas refinadas hacen que agarrarlo sea cómodo y que la navegación en pantalla sea más fácil.</p><br><p>Elegí cómo sacar tus fotos con el sistema multicámara</p><p>Convertí tu galería de fotos en una colección de tesoros captados con tu toque creativo. El sistema multicámara del Galaxy A22 lleva tus fotos a otro nivel con cuatro cámaras para capturar los momentos inolvidables de cuatro maneras diferentes.</p><br><p>Capturá los detalles incluso con poca luz gracias a OIS</p><p>Olvidate de las fotos y videos borrosos gracias a la cámara principal de 48MP con OIS. La estabilización óptica de imagen (Optical Image Stabilization, OIS) te ayuda a tomar videos más fluidos y nítidos y a captar más luz para iluminar las tomas con poca luz.</p><br><p>La cámara macro pone atención a los detalles más pequeños</p><p>Acercate con la cámara macro de 2MP y sacá a relucir hasta los más mínimos detalles de tus fotos. Le aplica un efecto bokeh natural a tus fotos, permitiendo que el sujeto resalte del fondo de la foto.</p><br><p>Compartí las mejores selfies con la cámara frontal</p><p>Con la cámara frontal de 13MP y el efecto bokeh, podés sacar selfies deslumbrantes y ser el centro de atención.</p><br><p>Una batería potente para que no te detengas</p><p>Sacale ventaja a tu día con una batería que no te frena. La batería de 5.000 mAh (típica) te permite continuar con tus tareas durante horas. Además, con una carga rápida adaptativa de hasta 15W, el Galaxy A22 recupera su potencia máxima rápidamente.</p><br><p>Mayor velocidad, mayor almacenamiento</p><p>El Galaxy A22 combina la potencia de su procesador Octa-core con la memoria RAM de hasta 4GB para obtener un rendimiento más rápido y eficiente. Disfrutá el almacenamiento interno de 128GB y agregale hasta 1TB más con una tarjeta MicroSD.</p><br><br><p>¿Hacen factura A?</p><p>Para que podamos emitir la factura A, necesitamos que la cuenta de Mercado Libre desde donde vayas a realizar la compra, esté registrada como IVA Responsable Inscripto o IVA Exento. De lo contrario, se va a emitir automáticamente una factura B.</p><p>Podrás actualizar esta información desde la sección \"Mis datos\".</p><br>",
